import { useParams } from "react-router-dom";
import { useGetPeopleQuery } from "./api";

type params = {
    name : string;
}

function PeoplePage() {
    const { name } = useParams<params>();

    const {data, isLaoding} = useGetPeopleQuery(name);

    return (
        <div>
            {isData ? (
                <div>Loading...</div>
            ) : (
                <ul>
                    {data.map((people) => (
                        <li key={people.id}>{people.login}</li>
                    ))}
                </ul>
            )
        } 
        </div>
    )
}

export default PeoplePage;
